  return (
    <>
      <h1>Product Catalog</h1>
      <CardWrapper>
        {props.products.map(product => (
          <Card>
          <Link exact to={`/products/${product.id}`}>
            <ProductCard key={product.id} {...props} product={product} />
          </Link>
          <button onClick={()=> {addToCart() }}>Add to cart</button>
          </Card>
        ))}
      </CardWrapper>
    </>
  )
};


export default Catalog;
